import React from 'react'
import './App.css';
import './assests/*.png'
import { Button, Container, Typography, Toolbar, AppBar } from '@material-ui/core';
function App() {
  return (
    <Container maxWidth="lg">
    <AppBar position="static">
    <Toolbar>
    <Typography>
    Get Started
    </Typography>
    </Toolbar>
    </AppBar>
    <img src ={amazon.png} className="frame" alt="No Preview"/>
    </Container>
  );
}

export default App;
